function HomePage(state, action) {
  switch (action.type) {
    case "SCROLLED":
      return Object.assign(state, { scrolled: true });
    case "NOT_SCROLLED":
      return Object.assign(state, { scrolled: false });
    case "SHOW_LOGIN":
      return { login: true };
    case "HIDE_LOGIN":
      return { login: false };
    default:
      return state;
  }
}

const reducer = {
  HomePage,
};

export default reducer;
